        img: water2
    },
    {
        id: 5,
        kind: "напої",
        title: "Mirinda",
        price: 30,
        img: water1
    },
    {
        id: 6,
        kind: "напої",
        title: "7 Up",
        price: 30,
        img: water3
    },
];

export default goods;

export const sizes = [
    { "S": 0 },
    { "M": 15 },
    { "L": 20 }
]
